import React from 'react';
import {Link} from 're'
import './style.scss';

import Logo from '../../assets/logo.png'

const Header = props =>{
    return(
        <header className='header'>
            <div className='wrap'>
                <div className='logo'>
                    <img src={Logo} alt='Ecommerce LOGO' />
                </div>
            </div>
        </header>
    )
}
export default Header
